import React from 'react';
import Navigationbr from '../components/Navigationbr';
import '<div styleName={"Main-section"}>.css';

export default function Main() {
  return (
    <div className="Main-section">
      <Navigationbr />
      {/* Logo */}
      <div className="logo-container">
        <img src="/path/to/logo.png" alt="Logo" className="logo-image" />
      </div>

      {/* Background Square */}
      <div className="background-square">
        <img src="/path/to/background-image.jpg" alt="Background" className="background-image" />
        <div className="content-container">
          <h1>Welcome to Our Platform</h1>
          <div className="buttons-container">
            <button className="square-button" onClick={() => alert('Button 1 clicked!')}>
              Button 1
            </button>
            <button className="square-button" onClick={() => alert('Button 2 clicked!')}>
              Button 2
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}
